import React, { Component }from 'react';
import classes from './GST.module.css';
import ServiceSideMenu from '../../UI/ServiceSideMenu/ServiceSideMenu';

class Gst extends Component {

    state = {
        selectedService : 'GST_Registration', 
    }
    services = [
        "GST_Registration",
        "GST_Filing",
    ];
    changeServiceHandler = (service) => {
        this.setState({
            selectedService:service
        })
    }
    render() {
        return (
            <section className={classes.Gst}>
                <ServiceSideMenu services={this.services} title="GST" clicked={this.changeServiceHandler}/>
            </section>
        );
    }

}

export default Gst;
